class Solution:
    def longestPrefix(self, s: str) -> str:
        prefix = 0
        suffix = 0
        base = 1
        MOD = 10 ** 9 + 7
        ans = None
        for i in range(len(s) - 1):
            prefix = (prefix * 26 + (ord(s[i]) - ord('a'))) % MOD
            suffix = (suffix + (ord(s[len(s) - 1 - i]) - ord('a')) * base) % MOD
            # print(s[:i + 1], s[-(i + 1):])
            # print(prefix, suffix)
            base = base * 26 % MOD
            if prefix == suffix:
                if s[:i + 1] == s[-(i + 1):]:
                    ans = i
                    # print(ans)
        return "" if ans == None else s[:ans + 1]


